import React, { Component } from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Dropdowns from './Dropdowns.js'
import CharacteristicInput from './CharacteristicInput.js'
import BrandInput from './BrandInput.js'
import '../App.css'

class IndexContainer extends Component {
    constructor(props) {
        super(props);
        this.state = {
            characteristicInput: 'ads',
            skinTone: '',
            skinType: '',
            eyeColor: '',
            brandInput: ''
        }
    }

    handleChangeCharacteristicInput(str) {
        // this.setState({
        //     characteristicInput: str
        // })
        console.log(str)
    }

    render() {
        // let characteristicInputs = this.state.characteristicInput
        return (
            <Container >
                <Row>
                    <CharacteristicInput
                        data = {this.state.characteristicInput}
                        // onChange = {this.handleChangeCharacteristicInput}
                    />
                </Row>
                <Row>
                    <BrandInput/>
                </Row>
                <Row>
                    <Dropdowns/>
                </Row>
            </Container>
        );
    }
}

export default IndexContainer;
